script: |
  super -f text -I q3832.spq | sort > q3832.out

inputs:
  - name: q3832.spq
    data: |
      SELECT ALL - 79 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN + col2 * col2 + - col0 * CAST ( NULL AS INTEGER ) AND ( + CAST ( NULL AS INTEGER ) * 12 );
  - name: tab2

outputs:
  - name: q3832.out
    data: |
